import React from 'react';
import './App.css';

export default class App extends React.Component {
  state = {
    person: [
      { name: 'John', key: 'ay' },
      { name: 'Vlo', key: 'by' },
    ],
  };

  render() {
    return (
      <div className='App'>
        {this.state.person.map((item) => {
          return <p key={item.key}>{item.name}</p>;
        })}
      </div>
    );
  }
}
